import React from "react";

const AddUser = () => {
  return (
    <div>
      <a
        className="relative block p-8 border border-gray-100 shadow-current rounded-xl"
      >
        <div className="mt-4 text-gray-500 sm:pr-8">
          <i class="ri-add-circle-line text-neutral-600text-3xl lg:text-5xl"></i>

          <h5 className="mt-4 text-xl font-bold text-neutral-600 text-center ">
            USER
          </h5>
        </div>
      </a>
    </div>
  );
};

export default AddUser;
